import React, { useState, useEffect } from "react";
import Rating from '@mui/material/Rating';
import './Header.css';

function List(){
  const [items, setItems] = useState([]);

  useEffect(() => {
    const fetchItems = async () => {
      try {
        const response = await fetch('http://localhost:3000/lists');
        const data = await response.json();
        setItems(data);
      } catch (err) {
        console.error('Error fetching data:', err);
      }
    };
    fetchItems();
  }, []);

  const Details = () => {
    window.location.replace("/Details");
  }

  return(
    <div className="boo ">
      <div className="container center p-4 w-5">
        <h3 className="fw-bold">CARDIAC CARE</h3>
        <div className="box col d-flex border-0 shadow">
          {items.map((item, index) => (
            <div key={index} className="mt-2 mb-2 p-3 w-50 m-2 shadow">
              <img className="pic" src={item.image} alt={item.name} />
              <p>{item.name}</p>
              <p className="fw-light">{item.quantity}</p>
              <Rating name="no-value" defaultValue={4.0} precision={0.5} readOnly />
              <div className="d-flex">
                <p className="me-2">MRP</p>
                <p className="text-danger">58% off</p>
              </div>
              <div className="d-flex">
                <button className="btn btn-warning w-50">Cart</button>
                <button className="btn btn-warning w-50 ms-2" onClick={Details}>Details</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default List;
